import './App.css';
import Register from './components/Register';
import Login from './components/Login';

function App() {

  const handleSubmit = (e) => {
    e.preventDefault();

  }

  return (
    <div className="App">
      <div className="formContainer">
        <Register handleSubmit={handleSubmit}/>
      </div>

      <div  className="formContainer">
        <Login handleSubmit={handleSubmit}/>
      </div>

    </div>
  );
}

export default App;
